INSERT INTO HJ.PRODUCT (PRODUCT_ID,PRODUCT_NAME,PRODUCT_BRAND,PRODUCT_PRICE,PRODUCT_INFO,PRODUCT_CATEGORY,PRODUCT_STOCK,PRODUCT_IMG) VALUES
	 (1001,'Beoplay EX Ferrari Edition','Bang&Olufsen',649000,'페라리 레드 패키지의 아름다운 디자인만큼 뛰어난 다양성을 지닌 이어버드는 무선 충전 케이스와 액티브 노이즈 캔슬링 기능을 갖추고 있으며 깊고 풍부한 사운드와 편안한 착용감을 제공합니다.','이어폰',-7,'//images.ctfassets.net/8cd2csgvqd3m/6CauM4itfCytfs4vYrSOVB/87fd4cbbacb842da0c4781bc558d4fdd/07_Beoplay_EX_Ferrari_8_Full_Angular_5K.png?q=85&fm=png&w=375&h=375&fit=fill'),
	 (1002,'Beoplay EX Oxygen','Bang&Olufsen',498000,'항상 유지되는 편안함. 언제나 나를 일깨우는 사운드. Beoplay EX는 어디에서 무엇을 하든 여러분을 좋아하는 아티스트에 좀더 가까이 데려갑니다.','이어폰',2,'https://images.ctfassets.net/8cd2csgvqd3m/4QIRGpRvCXZ6j2PYiyVxmR/efe41b2878a4874c079ce148b84db997/Packshot-Beoplay-Ex-Anthracite-Oxygen-0034-Perspective-S1200x1200px.png?q=90&fm=webp&w=1200&h=1200&fit=fill'),
	 (1003,'Beoplay H95 Ferrari Edition','Bang&Olufsen',1899000,'뱅앤올룹슨의 최고급 헤드폰과 가장 빠른 페라리의 레드 컬러가 만났습니다. 여태껏 경험할 수 없었던 디테일과 함께 가장 좋아하는 음악을 즐겨보세요. 헤드폰을 착용할 때마다 엔지니어와 아티스트의 장인 정신을 느껴보세요. 티타늄 드라이버가 음악에 파워를 더합니다. 이어컵 휠을 사용해 원하는 수준으로 소음을 차단할 수 있습니다.','헤드폰',0,'//images.ctfassets.net/8cd2csgvqd3m/6AC1YbgSfBFzqeFuOUaIlZ/ddbeea76259546f060a4edd8c4568a4e/Pack_Shot_-_Beoplay-H95-Ferrari.png?q=85&fm=png&w=375&h=375&fit=fill'),
	 (1004,'Beoplay H95 Black','Bang&Olufsen',14480,'Bang & Olufsen의 역대 가장 뛰어난 헤드폰으로 선명하게 통화하세요. 심금을 울리는 사운드와 정교한 세공술 그리고 평생 사용 가능한 내구성.','헤드폰',-3,'//images.ctfassets.net/8cd2csgvqd3m/4LDrvOSN2bdGyvQbYIKRfj/689345b78e59ffaaff2789c2c6b01ab8/Packshot-Beoplay-H95-Black-0043-Perspective-1200x1200px.png?q=85&fm=png&w=375&h=375&fit=fill'),
	 (1005,'Beoplay HX Brown','Bang&Olufsen',6780,'하루 종일 사용해도 편안합니다. 35시간 동안 재생할 수 있습니다. 뛰어난 활용성. Beoplay HX는 사용자를 온전한 사운드 세상으로 이끌었다 현실 세계로 다시 데려다 줍니다.','헤드폰',-28,'//images.ctfassets.net/8cd2csgvqd3m/3zMbwPFhHDHkbq31CIjGdg/24c5fc443a752c746524722ac83ce72d/Packshot-Beoplay-HX-Timber-0061-Perspective-S1200x1200px.png?q=85&fm=png&w=375&h=375&fit=fill'),
	 (1006,'Beoplay Portal Black','Bang&Olufsen',6790,'Hi-Fi 3D 사운드. 앉은 자리 그대로 편안하다. Portal에 들어 오시면 나갈 생각이 안 듭니다.','헤드폰',-9,'//images.ctfassets.net/8cd2csgvqd3m/01gGDwUWNQq9Yy64jbk4Tb/f7e307c18fcffa83209113ff78823ab9/Portal_Black_1.png?q=85&fm=png&w=375&h=375&fit=fill'),
	 (1007,'Beosound Explore Ferrari Edition','Bang&Olufsen',3599000,'방수 실외 스피커','스피커',0,'//images.ctfassets.net/8cd2csgvqd3m/J8GGc7dgB91SlE87ByiwU/e2596ef9f27a6fa3043f89f4e30f61cc/05_Explore-Ferrari_Front_5K.png?q=85&fm=png&w=375&h=375&fit=fill'),
	 (1008,'베오사운드 A5','Bang&Olufsen',1489000,'강력한 성능의 새로운 휴대용 스피커','스피커',0,'//images.ctfassets.net/8cd2csgvqd3m/4PZg3P4irAYjVwAPcFIw9v/5d52752cda2a7304b748f0e5a5ee9733/Beosound_A5_-_PDP_-_Image_1.png?q=90&amp;fm=webp&amp;w=720&amp;h=720&amp;fit=fill'),
	 (1009,'Beosound A9','Bang&Olufsen',4698000,'파워풀하고 미니멀한 스피커','스피커',0,'//images.ctfassets.net/8cd2csgvqd3m/5ffQPWX2hMWg1Lcvv4Ndmh/715d29139574b6992a7db3b00ff04053/A9_Gold_1_Resized.png?q=85&fm=png&w=375&h=375&fit=fill'),
	 (1010,'베오사운드 밸런스','Bang&Olufsen',4198000,'훌륭한 거실용 스피커','스피커',5,'//images.ctfassets.net/8cd2csgvqd3m/7MXEcPoelk9EOpjFQXN5Zt/aee5c1d419b88ce069c4575749840a58/Packshot-Beosound-Balance-Natural-Oak-0079-Front-1200x1200px.png?q=85&fm=png&w=375&h=375&fit=fill');
